<script>
    /*
        [문제]
       let numberList = [131, 113, 138, 180, 134, 173, 157, 149, 121, 104];
        numberList에서 십의 자리가 20의 약수인 수만 출력하시오.
    */
    /*
        [출력예시]
        113 157 149 121
    */
    let numberList = [131, 113, 138, 180, 134, 173, 157, 149, 121, 104];
    
    for(let i = 0; i < numberList.length; i++){
        let a = numberList[i];
        let a1 = parseInt(a % 100 / 10);
        if(a1 == 0){
            continue;
        }
        let check = 20 % a1 == 0;
        if(check){
            document.write(a + " ");
        }
    }
</script>
